import React from "react";

const ContactForm = () => {
  return (
    <div className='contact-form-container'>
      <div className='contact-form-title'></div>
      <div className='contact-form-subtext'></div>
      <form className='contact-form'>
        <div className='input-wrapper'>
          <input
            type='text'
            name='name'
            // value={name}
            // onChange={onChange}
            placeholder='Name'
          />
        </div>
        <div className='input-wrapper'>
          <input
            type='email'
            name='email'
            // value={email}
            // onChange={onChange}
            placeholder='Email'
          />
        </div>
        <div className='input-wrapper'>
          <input
            type='text'
            name='subject'
            // value={subject}
            // onChange={onChange}
            placeholder='Subject'
          />
        </div>
        <div className='input-wrapper'>
          <input
            type='textarea'
            name='message'
            // value={message}
            // onChange={onChange}
            placeholder='Message'
          />
        </div>

        <div className='form-btn'>
          <input type='submit' value='Login' />
        </div>
      </form>
    </div>
  );
};

export default ContactForm;
